import React from "react";
import JsonData from "./MOCK_DATA.json";
import Card from "./Card";

const SearchFilter = () => {
  return (
    <>
      <input type="text" placeholder="search..." name="seachInput" />

      {JsonData.map((value, key) => {
        return (
          <div>
           {} {value.first_name}
          </div>
        )
      })}
    </>
  );
};

export default SearchFilter;
